import React from 'react';
import Blurb from './Blurb';
import { Image } from 'semantic-ui-react'

class App extends React.Component {

	render(){
		return (
			<div>
				<Blurb />
				<Image src='../images/test.png' style={{ marginTop: '2em' }} />
			</div>
		);
	}
}

export default App;
